import React from 'react';
import { Button, TextField, FormControl, DialogActions } from '@material-ui/core';

export default function FormContent(){
    return (
        <form>
            <FormControl>
                <TextField
                    autoFocus
                    margin="dense"
                    id="name"
                    label="Email Address"
                    type="email"
                    fullWidth
                />
            </FormControl>
        </form>
    );
}
